import React, { useEffect, useState } from 'react';
import KakaoMap from './KakaoMap';

const Main = () => {

  const [member1List, setMember1List] = useState(["Hello"])
  const [member2List, setMember2List] = useState(["World"])
  var temp_memberList = []

  useEffect(() => {
    fetch('http://localhost:8080/member1')
      .then(response => response.json())
      .then(response => {
        setMember1List(response)
      })
      .catch(error => console.error('Error fetching data:', error));
  }, []);

  useEffect(() => {
    fetch('http://localhost:8080/member2')
      .then(response => response.json())
      .then(response => {
        setMember2List(response)
        memberList()
      })
      .catch(error => console.error('Error fetching data:', error));
  }, []);

  const memberPrint = (arr) => {

    const result = []

    for (let i = 0; i < arr.length; i++) {

      result.push(
        <div>
          {arr[i].mb_name}
          {arr[i].mb_address}
          {arr[i].mb_tel}
        </div>
      )

    }
    return (
      <>
        {result}
      </>
    );
  }



  const memberLatLong = (list) => {
    for (let i = 0; i < list.length; i++) {
      console.log(list.mb_latitude)
      console.log(list.mb_latitude)
    }
  }

  return (
    <>
    
    {memberLatLong(member1List)}
    {memberLatLong(member2List)}
    <KakaoMap latlong1={member1List} latlong2={member2List}/>
    </>
  )


}


export default Main;
